To illustrate the includeSnapshotsFrom parameter, consider the hook that reacts to changes of labels of all Pods and requires the content of the ConfigMap named "settings-for-my-hook". There is also a schedule to do periodic checks: configVersion: v1
schedule:
- name: periodic-checking crontab: "0 */3 * * *" includeSnapshotsFrom: ["monitor-pods", "configmap-content"]
kubernetes:
- name: configmap-content kind: ConfigMap nameSelector: matchNames: ["settings-for-my-hook"] executeHookOnSynchronization: false executeHookOnEvent: []
- name: monitor-pods kind: Pod jqFilter: '.metadata.labels' includeSnapshotsFrom: ["configmap-content"] This hook will not be executed for events related to the binding "configmap-content". executeHookOnSynchronization: false accompanied by executeHookOnEvent: [] defines a "snapshot-only" binding. This is one of the techniques to reduce the number of kubectl invocations. "Synchronization" binding context with snapshots During startup, the hook will be executed with the "Synchronization" binding context with snapshots and objects: [ { "binding": "monitor-pods", "type": "Synchronization", "objects": [ { "object": { "kind": "Pod", "metadata": { "name": "etcd-...", "namespace": "kube-system", "labels": { ... }, ... }, }, "filterResult": { "label1": "value", ... } }, { "object": { "kind": "Pod", "metadata": { "name": "kube-proxy-...", "namespace": "kube-system", ... }, }, "filterResult": { "label1": "value", ... } }, ... ], "snapshots": { "configmap-content": [ { "object": { "kind": "ConfigMap", "metadata": {"name": "settings-for-my-hook", ... }, "data": {"field1": ... } } } ] } }
] "Event" binding context with snapshots If pod pod-321d12 is then added into the "default" namespace, then the hook will be executed with the "Event" binding context with object and filterResult fields: [ { "binding": "monitor-pods", "type": "Event", "watchEvent": "Added", "object": { "apiVersion": "v1", "kind": "Pod", "metadata": { "name": "pod-321d12", "namespace": "default", ... }, "spec": { ... }, ... }, "filterResult": { ... }, "snapshots": { "configmap-content": [ { "object": { "kind": "ConfigMap", "metadata": {"name": "settings-for-my-hook", ... }, "data": {"field1": ... } } } ] } }
] "Schedule" binding context with snapshots Every 3 hours, the hook will be executed with the binding context that include 2 snapshots ("monitor-pods" and "configmap-content"): [ { "binding": "periodic-checking", "type": "Schedule", "snapshots": { "monitor-pods": [ { "object": { "kind": "Pod", "metadata": { "name": "etcd-...", "namespace": "kube-system", ... }, }, "filterResult": { ... }, }, ... ], "configmap-content": [ { "object": { "kind": "ConfigMap", "metadata": {"name": "settings-for-my-hook", ... }, "data": {"field1": ... } } } ] } }
]

