operation — specifies an operation's type. CreateOrUpdate — accept a Kubernetes object. It retrieves an object, and if it already exists, computes a JSON Merge Patch and applies it (will not update .status field). If it does not exist, we create the object. Create — will fail if an object already exists CreateIfNotExists — create an object if such an object does not already exist by namespace/name. object — full object specification including "apiVersion", "kind" and all necessary metadata. Can be a normal JSON or YAML object or a stringified JSON or YAML object. Example { "operation": "CreateOrUpdate", "object": { "apiVersion": "apps/v1", "kind": "DaemonSet", "metadata": { "name": "flannel", "namespace": "d8-flannel" }, "spec": { "selector": { "matchLabels": { "app": "flannel" } }, "template": { "metadata": { "labels": { "app": "flannel", "tier": "node" } }, "spec": { "containers": [ { "args": [ "--ip-masq", "--kube-subnet-mgr" ], "image": "flannel:v0.11", "name": "kube-flannel", "securityContext": { "privileged": true } } ], "hostNetwork": true, "imagePullSecrets": [ { "name": "registry" } ], "terminationGracePeriodSeconds": 5 } }, "updateStrategy": { "type": "RollingUpdate" } } }
} operation: Create
object: apiVersion: v1 kind: ConfigMap metadata: namespace: default name: testcm data: ... operation: Create
object: | {"apiVersion":"v1", "kind":"ConfigMap", "metadata":{"namespace":"default","name":"testcm"}, "data":{"foo": "bar"}}

