Use JQPatch for almost everything. Consider using MergePatch or JSONPatch if you are attempting to modify rapidly changing object, for example status field with many concurrent changes (and incrementing resourceVersion). Be careful, when updating a .status field. If a /status subresource is enabled on a resource, it'll ignore updates to the .status field if you haven't specified subresource: status in the operation spec. More info here . JQPatch operation — specifies an operation's type. apiVersion — optional field that specifies object's apiVersion. If not present, we'll use preferred apiVersion for the given kind. kind — object's Kind. namespace — object's Namespace. If empty, implies operation on a Cluster-level resource. name — object's name. jqFilter — describes transformations to perform on an object. subresource — a subresource name if subresource is to be transformed. For example, status. Example { "operation": "JQPatch", "kind": "Deployment", "namespace": "default", "name": "nginx", "jqFilter": ".spec.replicas = 1"
} MergePatch operation — specifies an operation's type. apiVersion — optional field that specifies object's apiVersion. If not present, we'll use preferred apiVersion for the given kind. kind — object's Kind. namespace — object's Namespace. If empty, implies operation on a Cluster-level resource. name — object's name. mergePatch — describes transformations to perform on an object. Can be a normal JSON or YAML object or a stringified JSON or YAML object. subresource — e.g., status. ignoreMissingObject — set to true to ignore error when patching non existent object. Example { "operation": "MergePatch", "kind": "Deployment", "namespace": "default", "name": "nginx", "mergePatch": { "spec": { "replicas": 1 } }
} operation: MergePatch
kind: Deployment
namespace: default
name: nginx
ignoreMissingObject: true
mergePatch: | spec: replicas: 1 JSONPatch operation — specifies an operation's type. apiVersion — optional field that specifies object's apiVersion. If not present, we'll use preferred apiVersion for the given kind. kind — object's Kind. namespace — object's Namespace. If empty, implies operation on a Cluster-level resource. name — object's name. jsonPatch — describes transformations to perform on an object. Can be a normal JSON or YAML array or a stringified JSON or YAML array. subresource — a subresource name if subresource is to be transformed. For example, status. ignoreMissingObject — set to true to ignore error when patching non existent object. Example { "operation": "JSONPatch", "kind": "Deployment", "namespace": "default", "name": "nginx", "jsonPatch": [ {"op": "replace", "path": "/spec/replicas", "value": 1} ]
} { "operation": "JSONPatch", "kind": "Deployment", "namespace": "default", "name": "nginx", "jsonPatch": "[ {\"op\": \"replace\", \"path\": \"/spec/replicas\", \"value\": 1} ]"
}

