Note that the group parameter is only for including snapshots. kubernetesCustomResourceConversion hook is never executed on schedule or kubernetes events with binding context with "type":"Group". The hook receives a binding context and should return response in $CONVERSION_RESPONSE_PATH. $BINDING_CONTEXT_PATH file example: [{
# Name as defined in binding configuration.
"binding": "alpha1_to_alpha2",
# type "Conversion" to distinguish from other events.
"type": "Conversion",
# Snapshots as defined by includeSnapshotsFrom or group.
"snapshots": { ... }
# fromVersion and toVersion as defined in a conversion rule.
"fromVersion": "unstable.crontab.io/v1beta1",
"toVersion": "stable.example.com/v1beta1",
# ConversionReview object.
"review": { "apiVersion": "apiextensions.k8s.io/v1", "kind": "ConversionReview", "request": { "desiredAPIVersion": "stable.example.com/v1beta1", "objects": [ { # A source version. "apiVersion": "unstable.crontab.io/v1beta1", "kind": "CronTab", "metadata": { "name": "crontab-v1alpha1", "namespace": "example-210", ... }, "spec": { "cron": [ "*", "*", "*", "*", "*/5" ], "imageName": [ "repo.example.com/my-awesome-cron-image:v1" ] } } ], "uid": "42f90c87-87f5-4686-8109-eba065c7fa6e" }
}
}] Response example: cat <<EOF >$CONVERSION_RESPONSE_PATH
{"convertedObjects": [{
# A converted version.
"apiVersion": "stable.example.com/v1beta1",
"kind": "CronTab",
"metadata": { "name": "crontab-v1alpha1", "namespace": "example-210", ...
},
"spec": { "cron": [ "*", "*", "*", "*", "*/5" ], "imageName": [ "repo.example.com/my-awesome-cron-image:v1" ]
}
}]}
EOF Return a message if something goes wrong: cat <<EOF >$CONVERSION_RESPONSE_PATH
{"failedMessage":"Conversion of crontabs.stable.example.com is failed"}
EOF User will see an error message: Error from server: conversion webhook for unstable.crontab.io/v1beta1, Kind=CronTab failed: Conversion of crontabs.stable.example.com is failed Empty or invalid $CONVERSION_RESPONSE_PATH file is considered as a fail with a short message about the problem and a more verbose error in the log. Note: kube-apiserver applies OpenAPI spec to the object returned by webhook. It can cause removing unknown fields without notifying a user.
